/* Table structure for Incidencia */
CREATE TABLE `Incidencia` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `lugar` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `titulo` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `fecha` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `palClave` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `estado` enum('pendiente','comprobada','tramitada','irresoluble','resuelta') COLLATE utf8_spanish_ci DEFAULT NULL,
  `descripcion` text COLLATE utf8_spanish_ci,
  `valPos` int(11) DEFAULT '0',
  `valNeg` int(11) DEFAULT '0',
  `posNetos` int(11) GENERATED ALWAYS AS ((`valPos` - `valNeg`)) VIRTUAL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

/* data for Table Incidencia */
INSERT INTO `Incidencia` VALUES (1,"Guarderia municipal","farolas rotas","2023-07-03 10:29:44","guarderia farolas ni&ntilde;os","pendiente","Unos ni&ntilde;os han roto las farolas que hay enfrente de la guarder&iacute;a. ",4,3,1);
INSERT INTO `Incidencia` VALUES (2,"Calle MiCasa, 16.","Robo en mi casa","2023-07-03 10:35:49","robo casa delincuencia","irresoluble","Anoche entraron a robar en mi casa, se llevaron la tele y un ordenador, que desastre. ",7,1,6);
INSERT INTO `Incidencia` VALUES (3,"colegio","Ventana del colegio rota","2023-07-04 11:04:19","colegio ventana","resuelta","Han tirado una piedra a la ventana del colegio, no sabemos si para hacer la gracia o porque querian robar",2,0,2);
INSERT INTO `Incidencia` VALUES (4,"Carretera norte","Carretera destrozada","2023-07-08 13:18:58","carretera rota salida norte arreglo","pendiente","La carretera de la salida en direcci&oacute;n norte esta destrozada, hay mucho tr&aacute;fico y necesitamos un arreglo &iexcl;YA!",5,2,3);
INSERT INTO `Incidencia` VALUES (5,"plaza central","Movil roto","2023-07-08 13:28:41","movil plaza","comprobada","Se me cay&oacute; el m&oacute;vil en la acera de la plaza principal por la baldosa que esta rota, encima en toda la c&aacute;mara ",0,1,-1);

